import React from 'react';
import { Text, View } from 'react-native';
import { NativeRouter, Switch, Route } from 'react-router-native';

import LogIn from './src/Pages/LogIn.js'


const App = () => {
  return (
    <NativeRouter>
      <Switch>
        <Route path="/" component={LogIn}/>
      </Switch>
    </NativeRouter>
  );
};

export default App;
